CREATE TABLE `product` (
  `id` int NOT NULL AUTO_INCREMENT,
  `name` varchar(30) NOT NULL,
  `price` double NOT NULL,
  `discount` float DEFAULT NULL,
  `in_stock` int NOT NULL,
  `description` text,
  PRIMARY KEY (`id`),
  CONSTRAINT `check_discount_length` CHECK ((`discount` >= 0)),
  CONSTRAINT `check_name_length` CHECK ((length(`name`) <= 30)),
  CONSTRAINT `check_price_length` CHECK ((`price` >= 0)),
  CONSTRAINT `check_stock_length` CHECK ((`discount` >= 0))
